import axios from "axios";

const KEY = {hfvhg3v7784ghvhj3vjhyw7t78t};

export default axios.create({
  baseURL: "https://www.googleapis.com/youtube/v3",
  params: {
    part: "snippet",
    maxResults: 5,
    key: KEY
  }
});
